import React from 'react'; // 引入 React 庫

function MyDisplay(){
    return <div className='display'>計算結果</div> // 渲染一個 div，顯示 "計算結果"，並應用 display 類名
}

export default MyDisplay; // 導出 MyDisplay 組件
